import React, { useState } from "react";
import styles from "./App.module.css";
import ExerciseCard from "./Exercisecard";
import NewExercise from "./Searchable";
import { Outlet } from "react-router";
import exerciseList from "./Exercise";



function CurrentWorkoutDisplay(props) {
    return (
        <div>
            {Object.keys(props.currExercises).map((key) => {
                return (<ExerciseCard
                    exerciseName={key}
                    addNewSet={props.addNewSet}
                    sets={currExercises[key]}
                />);
            })}
        </div>
    );
}

export default CurrentWorkoutDisplay;
